BEGIN;
CREATE TABLE IF NOT EXISTS `cars` (
	`id_trim`	INTEGER,
	`make`	varchar(255),
	`model`	varchar(255),
	`generation`	varchar(255),
	`year_from`	INTEGER,
	`year_to`	INTEGER,
	`series`	varchar(255),
	`trim`	varchar(255),
	`body_type`	varchar(255),
	`number_of_seats`	INTEGER,
	`length_mm`	INTEGER,
	`width_mm`	INTEGER,
	`height_mm`	INTEGER,
	`number_of_cylinders`	INTEGER,
	`engine_type`	varchar(255),
	`drive_wheels`	varchar(255),
	`transmission`	varchar(255),
	`max_speed_km_per_h`	INTEGER
);
COMMIT;
